import React from 'react';

const DownloadComponent = () => {
    // Your GitHub release information
    const releaseInfo = {
        fileName: "JBMMSI.apk",
        fileSize: "95.2 MB",
        version: "v1.0.0",
        releaseDate: "November 2025"
    };

    const handleDownload = () => {
        console.log('Download started:', releaseInfo.fileName);
    };

    const handleGitHubClick = () => {
        window.open(releaseInfo.githubPage, '_blank');
    };

    return (
        <div className="download-section">
            <div className="container">
                {/* Header Section */}
                <div className="section-header">
                    <h1>JBMMSI Mobile App</h1>
                    <p className="tagline">Stay connected with quality education on the go</p>
                </div>

                <div className="download-content">
                    {/* App Image Section */}
                    <div className="app-preview">
                        <div className="phone-mockup">
                            <div className="phone-frame">
                                <img 
                                    src="/image/mobile.png" 
                                    alt="JBMMSI Mobile App"
                                    className="app-screenshot"
                                    onError={(e) => {
                                        e.target.style.backgroundColor = '#2c5aa0';
                                        e.target.style.display = 'flex';
                                        e.target.style.alignItems = 'center';
                                        e.target.style.justifyContent = 'center';
                                        e.target.style.color = 'white';
                                        e.target.style.fontSize = '10px';
                                        e.target.innerHTML = 'ðŸ“± JBMMSI App Preview';
                                    }}
                                />
                            </div>
                        </div>
                    </div>

                    {/* Download Info Section */}
                    <div className="download-info">
                        <div className="mission-statement">
                             <div className="feature-icon">ðŸŽ¯</div>
                            <p>
                                Our mobile app extends our mission to create a learning environment that fosters 
                                curiosity, creativity, and critical thinking while instilling strong moral values.
                                Access highest standards of academic resources and materials on your mobile device.
                                Stay connected with announcements and demonstrate compassion through our community features.
                            </p>
                        </div>

                        {/* Features Grid */}
                        <div className="features-grid">
                            <div className="feature-card">
                               
                                <h3>Excellence</h3>
                                <p>Access highest standards of academic resources and materials on your mobile device.</p>
                            </div>
                            
                        </div>

                        {/* Download Section */}
                        <div className="download-action">
                            <h3>Download Now</h3>
                            <div className="version-info">
                                <span className="version">Version {releaseInfo.version}</span>
                                <span className="size">{releaseInfo.fileSize}</span>
                            </div>

                            <div className="download-buttons">
                                <a 
                                    href={releaseInfo.directUrl}
                                    download={releaseInfo.fileName}
                                    className="download-btn primary"
                                    onClick={handleDownload}
                                >
                                    <span className="btn-icon">ðŸ“¥</span>
                                    Download JBMMSI App
                                </a>

                            </div>

                            <div className="file-details">
                                <div className="detail-item">
                                    <strong>File:</strong> {releaseInfo.fileName}
                                </div>
                                <div className="detail-item">
                                    <strong>Compatibility:</strong> Android 8.0+
                                </div>
                                <div className="detail-item">
                                    <strong>Last Updated:</strong> {releaseInfo.releaseDate}
                                </div>
                            </div>
                        </div>

                        {/* Installation Guide */}
                        <div className="installation-guide">
                            <h4>Installation Instructions</h4>
                            <div className="steps">
                                <div className="step">
                                    <span className="step-number">1</span>
                                    <p>Click "Download JBMMSI App" button</p>
                                </div>
                                <div className="step">
                                    <span className="step-number">2</span>
                                    <p>Open the downloaded APK file</p>
                                </div>
                                <div className="step">
                                    <span className="step-number">3</span>
                                    <p>Allow installation from unknown sources if prompted</p>
                                </div>
                                <div className="step">
                                    <span className="step-number">4</span>
                                    <p>Follow the installation steps</p>
                                </div>
                                <div className="step">
                                    <span className="step-number">5</span>
                                    <p>Launch the app and start learning!</p>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default DownloadComponent;
